[[module css]]

.page-tags {
    display: none;
}

#breadcrumbs {
    display: none;
}

body, #container-wrap-wrap, #container-wrap, #content-wrap, #page-content {
    min-height: unset !important;
}

.page-content {
    height: 95vh;
    position: sticky;
    top: 0px;
}

#header {
    background-position: 1em 4em;
    background-size: 88px 88px;
    display: none;
}

#content-wrap {
    margin: 0 auto 0;
    max-width: 1040px;
    padding: 0em 0em 0em 0em;
}

#main-content {
    max-width: 100%;
    margin: 0;
}

#container-wrap {
    background: none;
}

#page-content {
    min-height: 720px;
}

#container {
    background: white;
}

#page-title {
    display:none;
