}

.checkpoints {
    transform: rotate(90deg);
    position: Fixed;
    right: 29vw;
    top: 46vw;
    width: 11vh;
    white-space: nowrap;
}

a {
    color: #fff;
}

a:visited {
    color: #fff;
}

.checkpoints a {
    color: #000;
}

.checkpoints a:visited {
    color: #000;
}

.introduce {
    transform: rotate(90deg);
    position: Fixed;
    right: 24vw;
    top: 100vw;
    width: 50vw;
    height: 75vw;
    color: #fff;
}

.back {
    transform: rotate(90deg);
    position: Fixed;
    right: 2vw;
    top: 19vw;
    width: 17vw;
    color: #fff;
    text-align: left;
    padding: 5px 20px 4px 12px;
}

.log {
    transform: rotate(90deg);
    position: Fixed;
    right: 2vw;
    top: 17vh;
    width: 100vw;
}

